  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a series of 21 georeferenced
  aerial images of Quivira National Wildlife Refuge version of an original black and
  white aerial photograph obtained from Earth Explorer (USGS) on November 4th, 1969.
  \ The original photos were georeferenced against Stafford County NAIP (2012) imagery.
  These images represents the refuge landscape approximately 15 years after the establishment
  of Quivira National Wildlife Refuge. These images allow a great look back in time
  to interpret habitat types and land use patterns.  These changes and others (extent
  of woody vegetation) can be made from these images using current imagery for comparison.
  These images are being used by refuge staff to assist in understanding and visualizing
  the historical content of the lands within the refuge and how they have changed
  over the last 80 years. Pixel resolution of this image is  1.5 meters. These images
  should be used for resource-level interpretation only.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
